import React from "react";
import Container from "react-bootstrap/Container";
import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";
import {Card} from "react-bootstrap";
import Vsc from "./vsc.png";
import Html from "./html.png";
import Css from "./css.png";
import Es6 from "./es6.jpeg";
import Node from "./node.png";
import Express from "./express.jpg";
import Sql from "./sql.jpg";
import Sqlze from "./sequelize.svg";
import Hdbrs from "./handlebars.png";
import Mongo from "./mongodb.png";
import Mongoose from "./mongoose.png";
import ReactJs from "./react.png";
import Github from "./github.png";

// import axios from "axios";
import "./grid.css";

class Gri extends React.Component {
    // constructor(props){
    //   super(props)
    //   // this.state={
    //   //   username: ""
    //   // }
    // }
    render(){
      return (
        <div className = "gridWrap">
        <Container>
        <Row> <h4>Row</h4>
            <Col>        
              <Card>
              <Card.Img src = {Vsc}fluid> 
              </Card.Img> 
              </Card>
            </Col>      
            <Col>        
              <Card>
              <Card.Img src = {Html}fluid> 
              </Card.Img> 
              </Card>
            </Col> 
            <Col>        
              <Card>
              <Card.Img src = {Css}fluid> 
              </Card.Img> 
              </Card>
            </Col>      
            <Col>        
              <Card>
              <Card.Img src = {Es6}fluid> 
              </Card.Img> 
              </Card>
            </Col>   
            </Row>
          <Row> <h4>Row</h4>
            <Col>        
              <Card>
              <Card.Img src = {Node}fluid> 
              </Card.Img> 
              </Card>
            </Col>      
            <Col>        
              <Card>
              <Card.Img src = {Express}fluid> 
              </Card.Img> 
              </Card>
            </Col> 
            <Col>        
              <Card>
              <Card.Img src = {Sqlze}fluid> 
              </Card.Img> 
              </Card>
            </Col>      
            <Col>        
              <Card>
              <Card.Img src = {Hdbrs}fluid> 
              </Card.Img> 
              </Card>
            </Col>   
            </Row>
            <Row> <h4>Row</h4>
            <Col>        
              <Card>
              <Card.Img src = {Mongo}fluid> 
              </Card.Img> 
              </Card>
            </Col>      
            <Col>        
              <Card>
              <Card.Img src = {Mongoose}fluid> 
              </Card.Img> 
              </Card>
            </Col> 
            <Col>        
              <Card>
              <Card.Img src = {ReactJs}fluid> 
              </Card.Img> 
              </Card>
            </Col>      
            <Col>        
              <Card>
              <Card.Img src = {Github}fluid> 
              </Card.Img> 
              </Card>
            </Col>   
            </Row>
        </Container>
        </div>
      )
    } 
}
    
  export default Gri;
